function Login(){

    function submitForm(e){
        e.preventDefault();
    }
    return (
        <div>
            <form onSubmit={submitForm}>
                <label>username</label>
                <input type="text"/>
                <label>password</label>
                <input type="password"/>
                <button>Login</button>
            </form>

        </div>

    );
}

export default Login;
